"use strict";

function fractionToDecimal(numerator, denominator) {
    if (numerator === 0) {
        return '0';
    }
    let res = [];
    let neg = (numerator > 0) ^ (denominator > 0);
    if (neg) {
        res.push('-');
    }
    let num = Math.abs(numerator);
    let d = Math.abs(denominator);
    res.push(Math.floor(num / d).toString());
    num %= d;
    if (num === 0) {
        return res.join('');
    }
    res.push('.');
    let mp = {};
    while (num !== 0) {
        mp[num] = res.length;
        num *= 10;
        res.push(Math.floor(num / d).toString());
        num %= d;
        if (num in mp) {
            let idx = mp[num];
            res.splice(idx, 0, '(');
            res.push(')');
            break;
        }
    }
    return res.join('');
}
